import React from 'react'
import '../../styles/team.css';

const Team = () => {
  return (
   <>
   <section id="team">
    <div className="container">
      <div className="team__content">
        <h6 className="subtitle">Our Team</h6>
      </div>
    </div>
   </section>
   </>
  )
}

export default Team
